pragma solidity ^0.8.30;
contract PEPE_STRATEGY is ERC20, Ownable,ReentrancyGuard {
    using SafeMath for uint256;

    IUniswapV2Router02 public immutable uniswapRouter;
    address public uniswapV2Pair;

    address constant public PEPE_TOKEN = payable(0x6982508145454Ce325dDbE47a25d4ec3d2311933);
    address constant public WETH_TOKEN = payable(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);
    address constant public DEAD_ADDRESS = payable(0x000000000000000000000000000000000000dEaD);

    uint256 private constant PROFIT_BPS = 1200;

    struct Order {
        uint256 ethSpent;
        uint256 pepeBought;
        uint256 timestamp;
        bool sold; 
    }

    uint256 public nextOrderId = 1;
    mapping(uint256 => Order) public orders;

    uint256 public minPepeBuy = 5 ether;
    uint256 public txReward = 0.01 ether; 

    bool private swapping;

    address public treasuryWallet;
    address public teamWallet;

    uint256 public maxTransactionAmount;
    uint256 public swapTokensAtAmount;
    uint256 public maxWallet;

    bool public limitsInEffect = true;
    bool public tradingActive = false;
    bool public swapEnabled = false;

    uint256 public buyTotalFees;
    uint256 public buyTreasuryFee;

    uint256 public sellTotalFees;
    uint256 public sellTreasuryFee;

    uint256 public tokensForTreasury;


    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) public _isExcludedMaxTransactionAmount;

    mapping(address => bool) public automatedMarketMakerPairs;

    event UpdateUniswapRouter(
        address indexed newAddress,
        address indexed oldAddress
    );

    event ExcludeFromFees(address indexed account, bool isExcluded);

    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    event treasuryWalletUpdated(
        address indexed newWallet,
        address indexed oldWallet
    );

    constructor() ERC20("Pepe Strategy", "PEPESTR") {
        IUniswapV2Router02 _uniswapRouter = IUniswapV2Router02(
            0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D 
        );

        excludeFromMaxTransaction(address(_uniswapRouter), true);
        uniswapRouter = _uniswapRouter;

        uint256 _buyTreasuryFee = 50; // 50% off at launch, 10% normally
        uint256 _sellTreasuryFee = 50; // 50% off at launch, 10% normally

        uint256 totalSupply = 1_000_000_000 * 1e18;

        maxTransactionAmount = totalSupply / 100;
        maxWallet = totalSupply / 100;
        swapTokensAtAmount = (totalSupply * 5) / 10000; 

        buyTreasuryFee = _buyTreasuryFee;
        buyTotalFees = buyTreasuryFee;

        sellTreasuryFee = _sellTreasuryFee;
        sellTotalFees = sellTreasuryFee;

        treasuryWallet = address(this);
        teamWallet = msg.sender;

        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);

        excludeFromMaxTransaction(owner(), true);
        excludeFromMaxTransaction(address(this), true);

        _mint(msg.sender, totalSupply);
    }

    receive() external payable {}

    function createPair() external onlyOwner {
        uniswapV2Pair = IUniswapV2Factory(uniswapRouter.factory())
            .createPair(address(this), uniswapRouter.WETH());
        excludeFromMaxTransaction(address(uniswapV2Pair), true);
        _setAutomatedMarketMakerPair(address(uniswapV2Pair), true);
    }

    function enableTrading() external onlyOwner {
        tradingActive = true;
        swapEnabled = true;
    }

    // remove limits after token is stable
    function removeLimits() external onlyOwner returns (bool) {
        limitsInEffect = false;
        return true;
    }

    // change the minimum amount of tokens to sell from fees
    function updateSwapTokensAtAmount(uint256 newAmount)
        external
        onlyOwner
        returns (bool)
    {
        swapTokensAtAmount = newAmount;
        return true;
    }

    function excludeFromMaxTransaction(address updAds, bool isEx)
        public
        onlyOwner
    {
        _isExcludedMaxTransactionAmount[updAds] = isEx;
    }

    function updateSwapEnabled(bool enabled) external onlyOwner {
        swapEnabled = enabled;
    }

    function updateBuyFees(
        uint256 _treasuryFee
    ) external onlyOwner {
        buyTreasuryFee = _treasuryFee;
        buyTotalFees = buyTreasuryFee;
    }

    function updateSellFees(
        uint256 _treasuryFee
    ) external onlyOwner {
        sellTreasuryFee = _treasuryFee;
        sellTotalFees = sellTreasuryFee;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function setAutomatedMarketMakerPair(address pair, bool value)
        public
        onlyOwner
    {
        require(
            pair != uniswapV2Pair,
            "The pair cannot be removed from automatedMarketMakerPairs"
        );

        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        automatedMarketMakerPairs[pair] = value;

        emit SetAutomatedMarketMakerPair(pair, value);
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }


    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        if (limitsInEffect) {
            if (
                from != owner() &&
                to != owner() &&
                to != address(0) &&
                !swapping
            ) {
                if (!tradingActive) {
                    require(
                        _isExcludedFromFees[from] || _isExcludedFromFees[to],
                        "Trading is not active."
                    );
                }

                //when buy
                if (
                    automatedMarketMakerPairs[from] &&
                    !_isExcludedMaxTransactionAmount[to]
                ) {
                    require(
                        amount <= maxTransactionAmount,
                        "Buy transfer amount exceeds the maxTransactionAmount."
                    );
                    require(
                        amount + balanceOf(to) <= maxWallet,
                        "Max wallet exceeded"
                    );
                }
                //when sell
                else if (
                    automatedMarketMakerPairs[to] &&
                    !_isExcludedMaxTransactionAmount[from]
                ) {
                    require(
                        amount <= maxTransactionAmount,
                        "Sell transfer amount exceeds the maxTransactionAmount."
                    );
                } else if (!_isExcludedMaxTransactionAmount[to]) {
                    require(
                        amount + balanceOf(to) <= maxWallet,
                        "Max wallet exceeded"
                    );
                }
            }
        }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (
            canSwap &&
            swapEnabled &&
            !swapping &&
            !automatedMarketMakerPairs[from] &&
            !_isExcludedFromFees[from] &&
            !_isExcludedFromFees[to]
        ) {
            swapping = true;

            swapBack();

            swapping = false;
        }

        bool takeFee = !swapping;

        // if any account belongs to _isExcludedFromFee account then remove the fee
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        uint256 fees = 0;
        // only take fees on buys/sells, do not take on wallet transfers
        if (takeFee) {
            // on sell
            if (automatedMarketMakerPairs[to] && sellTotalFees > 0) {
                fees = amount.mul(sellTotalFees).div(100);
                tokensForTreasury += (fees * sellTreasuryFee) / sellTotalFees;
            }
            // on buy
            else if (automatedMarketMakerPairs[from] && buyTotalFees > 0) {
                fees = amount.mul(buyTotalFees).div(100);
                tokensForTreasury += (fees * buyTreasuryFee) / buyTotalFees;
            }

            if (fees > 0) {
                super._transfer(from, address(this), fees);
            }

            amount -= fees;
        }

        super._transfer(from, to, amount);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapRouter.WETH();

        _approve(address(this), address(uniswapRouter), tokenAmount);

        // make the swap
        uniswapRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function swapBack() private {
        uint256 contractBalance = balanceOf(address(this));
        uint256 totalTokensToSwap = tokensForTreasury;
        bool success;

        if (contractBalance == 0 || totalTokensToSwap == 0) {
            return;
        }

        if (contractBalance > swapTokensAtAmount * 20) {
            contractBalance = swapTokensAtAmount * 20;
        }


        uint256 amountToSwapForETH = contractBalance;
        uint256 initialETHBalance = address(this).balance;
        swapTokensForEth(amountToSwapForETH);
        uint256 ethBalance = address(this).balance.sub(initialETHBalance);
        tokensForTreasury = 0;

        uint256 teamShare = ethBalance.mul(20).div(100);

        if (teamWallet != address(0)) {
            (success, ) = teamWallet.call{value: teamShare}("");
        }
    }

    /* pepe funcs */

    function updateRewards(uint256 val) external onlyOwner {
        txReward = val;
    }

    function updateMinPepeBuy(uint256 val) external onlyOwner {
        minPepeBuy = val;
    }

    function updateTeamWallet(address newWallet) external onlyOwner {
        require(newWallet != address(0), "Zero address not allowed");
        teamWallet = newWallet;
    }

    function buyPepe() external nonReentrant{
        uint256 treasuryBalance = address(this).balance;
        require(treasuryBalance >= minPepeBuy + txReward, "Not enough ETH in treasury");

        uint256 beforePepeBalance = IERC20(PEPE_TOKEN).balanceOf(address(this));
        address[] memory path = new address[](2);
        path[0] = uniswapRouter.WETH();
        path[1] = PEPE_TOKEN;

        uniswapRouter.swapExactETHForTokensSupportingFeeOnTransferTokens{value: treasuryBalance - txReward}(
            0, 
            path,
            address(this),
            block.timestamp
        );
        uint256 afterPepeBalance = IERC20(PEPE_TOKEN).balanceOf(address(this));
        uint256 pepeBought = afterPepeBalance - beforePepeBalance;

        uint256 orderId = nextOrderId++;
        orders[orderId] = Order({
            ethSpent: treasuryBalance - txReward,
            pepeBought: pepeBought,
            timestamp: block.timestamp,
            sold: false
        });

        payable(msg.sender).transfer(txReward);

    }

    function sellPepe(uint256 orderId) external nonReentrant{
        Order storage order = orders[orderId];
        require(!order.sold, "Already sold");
        require(previewSell(order.pepeBought) * 1000 >= order.ethSpent * PROFIT_BPS, "Profit threshold not met");

        require(IERC20(PEPE_TOKEN).balanceOf(address(this)) >= order.pepeBought, "Not enough PEPE in contract");

        IERC20(PEPE_TOKEN).approve(address(uniswapRouter), order.pepeBought);

        address[] memory path = new address[](3);
        path[0] = PEPE_TOKEN;
        path[1] = uniswapRouter.WETH();
        path[2] = address(this);

        uniswapRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            order.pepeBought,
            0,
            path,
            address(DEAD_ADDRESS),
            block.timestamp
        );

        order.sold = true;

        payable(msg.sender).transfer(txReward);

    }

    function previewSell(uint256 amountIn) public view returns (uint256 ethExpected) {
        address[] memory path = new address[](2);
        path[0] = PEPE_TOKEN;
        path[1] = uniswapRouter.WETH();

        uint[] memory amounts = uniswapRouter.getAmountsOut(amountIn, path);
        ethExpected = amounts[1]; // path[1] = ETH (WETH)
    }

    function stats() public view returns(uint256[] memory){
        uint256[] memory data = new uint256[](3);
        data[0] = IERC20(address(this)).balanceOf(DEAD_ADDRESS); // data0
        data[1] = address(this).balance; // data1
        data[2] = IERC20(PEPE_TOKEN).balanceOf(address(this)); // data2
        return data;
    }
}
